function propuesta() {
    console.log("bai!");
    $.getJSON('script.php', function(e) {
        codigo = e.result;
    });
    
	$(".calculator_box .container").css("display","none");
	$(".form_propuesta").css("display","block");
    $(".produto_inputs").html("");
    console.log(json);
    var length=Object.keys(json).length;
    for(i=0;i<length-1;i++){
        $(".produto_inputs").append('<div class="produto_line" data-id="'+i+'"><input type="text" class="div_name_p" value="'+json[i].produto2+'" /><input class="input_p_nr" type="text" value="'+json[i].nr+'"/><input class="input_p_u" type="text" value="'+json[i].precio_u+'"/><div class="input_p">'+json[i].precio_t+'</div></div>');
    }
    
    $('.input_p_nr').bind('input', function() {
        var nr_p=$(this).val();
        var id=$(this).parent().attr("data-id");
        var p_u=$(".produto_line[data-id="+id+"]").children(".input_p_u").attr("value");
        var new_p=p_u*nr_p;
        $(".produto_line[data-id="+id+"]").children(".input_p").html(new_p.toFixed(2));
        json[id].nr=nr_p;
        json[id].precio_t=new_p.toFixed(2);
        var length=Object.keys(json).length;
        var total=0;
        for(i=0;i<length-1;i++){
            total=total + parseInt(json[i].precio_t);
        }
        
        json[length-1].precio_t=total.toFixed(2);
    });
    
    $('.input_p_u').bind('input', function() {
        var p_u=$(this).val();
        var id=$(this).parent().attr("data-id");
        var nr=$(".produto_line[data-id="+id+"]").children(".input_p_nr").attr("value");
        var new_p=p_u*nr;
        $(".produto_line[data-id="+id+"]").children(".input_p").html(new_p.toFixed(2));
        json[id].precio_u=parseFloat(p_u).toFixed(2);
        json[id].precio_t=new_p.toFixed(2);
        
        var length=Object.keys(json).length;
        var total=0;
        for(i=0;i<length-1;i++){
            total=total + parseInt(json[i].precio_t);
        }
        
        json[length-1].precio_t=total.toFixed(2);
    });
    
    $('.div_name_p').bind('input', function() {
        var name2=$(this).val();
        var id=$(this).parent().attr("data-id");

        json[id].produto2=name2;
    });
   $('#comercial').change(function() {
      id_com=$(this).val();
    });

}





